import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './pages/Home';
import Work from './pages/Work';
import About from './pages/About';
import SocialDock from './components/SocialDock';
import CaseStudyHel from './pages/Hel_fi'; // Make sure this matches your file name
import './GlobalStyles.css';
import FiraBrand from './pages/FiraBrand';
import Hel_fi from './pages/Hel_fi';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/work" element={<Work />} />
          <Route path="/about" element={<About />} />
          <Route path="/work/Hel_fi" element={<Hel_fi />} />
          <Route path="/work/FiraBrand" element={<FiraBrand />} />
        </Routes>
        <Footer />
        <SocialDock />
      </div>
    </Router>
  );
}

export default App;
